-------------------------------------------------------
-- Table creation DDL
-------------------------------------------------------

CREATE TABLE "INSTITUTION" (
    "ID" NUMBER(19, 0) CONSTRAINT "NN_#INST_$ID" NOT NULL ENABLE,
    "UUID" RAW(16) CONSTRAINT "NN_#INST_$UUID" NOT NULL ENABLE,
    "ENTITY_VERSION" NUMBER(19, 0) CONSTRAINT "NN_#INST_$ENTVER" NOT NULL ENABLE,

    "MANTAINER_ID" NUMBER(19, 0),

    "CNPJ" VARCHAR2(14 CHAR),

    "SOURCE" VARCHAR2(8 CHAR) CONSTRAINT "NN_#INST_$SRC" NOT NULL ENABLE,
    "SOURCE_ID" VARCHAR2(8 CHAR) CONSTRAINT "NN_#INST_$SRCID" NOT NULL ENABLE,
    "SOURCE_URL" VARCHAR2(128 CHAR),

    "FULL_NAME" VARCHAR2(128 CHAR) CONSTRAINT "NN_#INST_$FUNAME" NOT NULL ENABLE,
    "FULL_NAME_NORMALIZED" VARCHAR2(128 CHAR) CONSTRAINT "NN_#INST_$FUNAMENORM" NOT NULL ENABLE,

    "SHORT_NAME" VARCHAR2(32 CHAR),
    "SHORT_NAME_NORMALIZED" VARCHAR2(32 CHAR),

    "REPRESENTATIVE" VARCHAR2(128 CHAR),
    "REPRESENTATIVE_OCCUPATION" VARCHAR2(128 CHAR),

    "ACADEMIC_ROLE" VARCHAR2(128 CHAR) CONSTRAINT "NN_#INST_$ACADROLE" NOT NULL ENABLE,
    "CATEGORY" VARCHAR2(8),

    "PHONES" VARCHAR2(128 CHAR),
    "EMAILS" VARCHAR2(128 CHAR),

    "HOME_PAGE" VARCHAR2(128 CHAR),

    "ADDRESS_ZIP" VARCHAR2(8 CHAR),
    "ADDRESS_STATE" VARCHAR2(2 CHAR),
    "ADDRESS_CITY" VARCHAR2(64 CHAR),
    "ADDRESS_DISTRICT" VARCHAR2(64 CHAR),
    "ADDRESS_STREET" VARCHAR2(128 CHAR),
    "ADDRESS_NUMBER" VARCHAR2(16 CHAR),
    "ADDRESS_COMPLEMENT" VARCHAR2(128 CHAR),

    "ACTIVE" NUMBER(1, 0) CONSTRAINT "NN_#INST_$ACTIVE" NOT NULL ENABLE,
    
    CONSTRAINT "PK_#INST_$ID" PRIMARY KEY ("ID") ENABLE,
    CONSTRAINT "FK_#INST_#INST" FOREIGN KEY ("MANTAINER_ID") REFERENCES "INSTITUTION" ("ID") ENABLE
);

-------------------------------------------------------
-- Table constraints
-------------------------------------------------------

-- Check constraint for ID. Ranges from 1 to JAVA Long.MAX_VALUE
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$ID" CHECK ("ID" BETWEEN 1 AND 9223372036854775807) ENABLE;

-- Check constraint for UUID. The length must be exactly 16, but the "LENGTH" function
-- always returns the value doubled, so we're checking for length = 32
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$UUID" CHECK (LENGTH("UUID") = 32) ENABLE;

-- Unique constraint for UUID
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "UK_#INST_$UUID" UNIQUE ("UUID") ENABLE;

-- Check constraint for ENTITY_VERSION. Ranges from 0 to JAVA Long.MAX_VALUE
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$ENTVER" CHECK ("ENTITY_VERSION" BETWEEN 0 AND 9223372036854775807) ENABLE;

-- Check constraint for CNPJ. Length must be exactly 14
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$CNPJ" CHECK (LENGTH("CNPJ") = 14) ENABLE;

-- Unique constraint for CNPJ
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "UK_#INST_$CNPJ" UNIQUE ("CNPJ") ENABLE;

-- Check constraint for ADDRESS_ZIP_CODE. Length must be exactly 8
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$ADDZIP" CHECK (LENGTH("ADDRESS_ZIP") = 8) ENABLE;

-- Check constraint for ADDRESS_STATE
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$ADDSTATE" CHECK ("ADDRESS_STATE" IN ('AC', 'AL', 'AP', 'AM', 'BA', 'CE', 'DF', 'ES', 'GO', 'MA', 'MT', 'MS', 'MG', 'PA', 'PB', 'PR', 'PE', 'PI', 'RJ', 'RN', 'RS', 'RO', 'RR', 'SC', 'SP', 'SE', 'TO')) ENABLE;

-- Check constraint for ACTIVE. It's a Boolean value, so it must be 0 or 1
ALTER TABLE "INSTITUTION" ADD CONSTRAINT "CHK_#INST_$ACTIVE" CHECK ("ACTIVE" BETWEEN 0 AND 1) ENABLE;

-------------------------------------------------------
-- Indexes
-------------------------------------------------------

-- Index for searchs
CREATE INDEX "IDX_#INST_$SEARCH" ON "INSTITUTION" ("ENTITY_VERSION","ACTIVE","ACADEMIC_ROLE","FULL_NAME_NORMALIZED","SHORT_NAME_NORMALIZED","CNPJ","SOURCE_ID");

-- Index for the foreign key on MANTAINER_ID. This is to avoid locks 
-- and full table scans
CREATE INDEX "IDX_#INST_$MANTID" ON "INSTITUTION"("MANTAINER_ID");

